import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function OperationalTimePage() {
  const [machines, setMachines] = useState([]);
  const [processes, setProcesses] = useState([]);
  const [selectedProcess, setSelectedProcess] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const serverIP = window.location.protocol + '//' + window.location.hostname;
    axios.get(`${serverIP}:5000/api/processes`).then(res => {
      setProcesses(res.data);
      const processIds = res.data.map(p => p.id);
      Promise.all(processIds.map(id => axios.get(`${serverIP}:5000/api/machines?processId=${id}`)))
        .then(results => {
          const allMachines = results.flatMap(r => r.data);
          Promise.all(
            allMachines.map(machine =>
              axios.get(`${serverIP}:5000/api/machines/${machine.id}/status-history`).then(res => ({
                ...machine,
                statusHistory: res.data
              }))
            )
          ).then(machinesWithHistory => {
            setMachines(machinesWithHistory);
            setLoading(false);
          });
        });
    });
  }, []);

  const calculateStoppedTime = (history) => {
    let totalStoppedTime = 0;
    let stopStartTime = null;
    history.forEach(entry => {
      if (entry.status === 'stop') {
        stopStartTime = new Date(entry.changed_at);
      } else if (entry.status === 'working' && stopStartTime) {
        const workingStartTime = new Date(entry.changed_at);
        totalStoppedTime += (workingStartTime - stopStartTime) / 1000; // seconds
        stopStartTime = null;
      }
    });
    return (totalStoppedTime / 60).toFixed(2); // minutes
  };

  const filteredMachines = selectedProcess
    ? machines.filter(m => m.process_id === selectedProcess)
    : machines;

  if (loading) return <div>Loading...</div>;

  return (
    <div className="responsive-container" style={{ minHeight: '100vh', background: '#f4f6fa', padding: 0 }}>
      <div style={{ maxWidth: 900, margin: '0 auto', background: '#fff', borderRadius: 12, boxShadow: '0 2px 12px #0001', padding: 32 }}>
        <h2 style={{ marginBottom: 32, color: '#1976d2' }}>Stopped to Working Time for All Machines</h2>
        <div style={{ display: 'flex', gap: 12, flexWrap: 'wrap', marginBottom: 24 }}>
          {processes.map(proc => (
            <button
              key={proc.id}
              onClick={() => setSelectedProcess(proc.id)}
              style={{
                padding: '8px 18px',
                background: selectedProcess === proc.id ? '#1976d2' : '#eee',
                color: selectedProcess === proc.id ? '#fff' : '#1976d2',
                border: '1px solid #1976d2',
                borderRadius: 6,
                fontWeight: 600,
                fontSize: 15,
                cursor: 'pointer',
                marginBottom: 4
              }}
            >
              {proc.name}
            </button>
          ))}
          {selectedProcess && (
            <button
              onClick={() => setSelectedProcess(null)}
              style={{
                padding: '8px 18px',
                background: '#fff',
                color: '#1976d2',
                border: '1px solid #1976d2',
                borderRadius: 6,
                fontWeight: 600,
                fontSize: 15,
                cursor: 'pointer',
                marginLeft: 8
              }}
            >
              Show All
            </button>
          )}
        </div>
        <table style={{ borderCollapse: 'collapse', width: '100%', background: '#fafbfc', borderRadius: 8, overflow: 'hidden', boxShadow: '0 1px 4px #0001' }}>
          <thead style={{ background: '#1976d2', color: '#fff' }}>
            <tr>
              <th style={{ padding: '12px 8px', fontWeight: 600 }}>Machine Name</th>
              <th style={{ padding: '12px 8px', fontWeight: 600 }}>Stopped Time (minutes)</th>
            </tr>
          </thead>
          <tbody>
            {filteredMachines.map(machine => (
              <tr key={machine.id} style={{ borderBottom: '1px solid #e0e0e0' }}>
                <td style={{ padding: '10px 8px' }}>{machine.name}</td>
                <td style={{ padding: '10px 8px', color: '#d32f2f', fontWeight: 500 }}>{calculateStoppedTime(machine.statusHistory)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
